import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Login.css'; // Reuse Login.css for consistent styling

const Signup = () => {
  const [isDarkMode, setIsDarkMode] = useState(false); // Add basic state
  const navigate = useNavigate();

  const config = {
    minUsernameLength: 3,
    minPasswordLength: 6,
    enableDarkMode: true,
  };

  useEffect(() => {
    const savedDarkMode = localStorage.getItem('darkMode') === 'true';
    setIsDarkMode(savedDarkMode);
    document.documentElement.setAttribute('data-theme', savedDarkMode ? 'dark' : 'light');
  }, []);

  return <div className={`login-page ${isDarkMode ? 'dark' : 'light'}`}>Signup Test</div>;
};

export default Signup;
